PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "migrations" ("id" integer not null primary key autoincrement, "migration" varchar not null, "batch" integer not null);
CREATE TABLE IF NOT EXISTS "users" ("id" integer not null primary key autoincrement, "name" varchar not null, "email" varchar not null, "username" varchar not null, "email_verified_at" datetime null, "password" varchar not null, "remember_token" varchar null, "created_at" datetime null, "updated_at" datetime null);
CREATE TABLE IF NOT EXISTS "password_resets" ("email" varchar not null, "token" varchar not null, "created_at" datetime null);
CREATE TABLE IF NOT EXISTS "failed_jobs" ("id" integer not null primary key autoincrement, "connection" text not null, "queue" text not null, "payload" text not null, "exception" text not null, "failed_at" datetime default CURRENT_TIMESTAMP not null);
CREATE TABLE IF NOT EXISTS "profiles" ("id" integer not null primary key autoincrement, "user_id" integer not null, "title" varchar null, "description" text null, "url" varchar null, "image" varchar null, "created_at" datetime null, "updated_at" datetime null);
CREATE TABLE IF NOT EXISTS "posts" ("id" integer not null primary key autoincrement, "user_id" integer not null, "caption" varchar not null, "image" varchar not null, "created_at" datetime null, "updated_at" datetime null);
CREATE TABLE IF NOT EXISTS "profile_user" ("id" integer not null primary key autoincrement, "profile_id" integer not null, "user_id" integer not null, "created_at" datetime null, "updated_at" datetime null);
CREATE TABLE IF NOT EXISTS "telescope_entries" ("sequence" integer not null primary key autoincrement, "uuid" varchar not null, "batch_id" varchar not null, "family_hash" varchar null, "should_display_on_index" tinyint(1) not null default '1', "type" varchar not null, "content" text not null, "created_at" datetime null);
CREATE TABLE IF NOT EXISTS "telescope_entries_tags" ("entry_uuid" varchar not null, "tag" varchar not null, foreign key("entry_uuid") references "telescope_entries"("uuid") on delete cascade);
CREATE TABLE IF NOT EXISTS "telescope_monitoring" ("tag" varchar not null);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "users_email_unique" on "users" ("email");
CREATE UNIQUE INDEX "users_username_unique" on "users" ("username");
CREATE INDEX "password_resets_email_index" on "password_resets" ("email");
CREATE INDEX "profiles_user_id_index" on "profiles" ("user_id");
CREATE INDEX "posts_user_id_index" on "posts" ("user_id");
CREATE UNIQUE INDEX "telescope_entries_uuid_unique" on "telescope_entries" ("uuid");
CREATE INDEX "telescope_entries_batch_id_index" on "telescope_entries" ("batch_id");
CREATE INDEX "telescope_entries_family_hash_index" on "telescope_entries" ("family_hash");
CREATE INDEX "telescope_entries_created_at_index" on "telescope_entries" ("created_at");
CREATE INDEX "telescope_entries_type_should_display_on_index_index" on "telescope_entries" ("type", "should_display_on_index");
CREATE INDEX "telescope_entries_tags_entry_uuid_tag_index" on "telescope_entries_tags" ("entry_uuid", "tag");
CREATE INDEX "telescope_entries_tags_tag_index" on "telescope_entries_tags" ("tag");
COMMIT;
